import { initializeApp } from 'firebase/app';
import "./form.css";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect
} from "react-router-dom";
import React from 'react';

import house from "./imgs/househelp1.png";

import Header from './Header';
import { PaymentPage } from './request/customer_details/Customer';
import Home from './home/Home.js';
import Signup from './home/Signup';
import Dashboard from './dashboard/dashboard';
import Login from './home/Login';
import { Customer } from './request/customer_details/Customer';
import {Request,Fulltime,Partime} from './request/Request';
import { getDatabase, ref ,push ,onValue} from "firebase/database";


  const firebaseConfig = {
    apiKey: "AIzaSyBk-m6q2o1dKuggqoNxjoKZHmXeMSHhjsA",
    authDomain: "PROJECT_ID.firebaseapp.com",
    databaseURL: "https://househelps2-default-rtdb.firebaseio.com/",
    projectId: "househelps2",
    storageBucket: "househelps2.appspot.com",
    messagingSenderId: "SENDER_ID",
    appId: "APP_ID",

  };

  const app = initializeApp(firebaseConfig);
  // const database = getDatabase();


  var submit = document.querySelector("#sumbit_button")













   function App() {
    return (
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/Login"></Link>
              </li>

              <li>
                <Link to="/Signup"></Link>
              </li>
              <li>
                <Link to="/Dashboard"></Link>
              </li>
              <li>
                <Link to="/"></Link>
              </li>
            </ul>
          </nav>

          <Switch>

            <Route path="/Signup">
              <Signup />
            </Route>

            <Route path="/customer">
              <Customer />
            </Route>

            <Route path="/partime">
              <Partime />
            </Route>


            <Route path="/Login">
              <Login />
            </Route>

            <Route path="/Dashboard">
              <Dashboard />
            </Route>
            <Route exact path="/request">
               <Request />
            </Route>
            <Route exact path="/fulltime">
               <Fulltime />
            </Route>
            <Route exact path="/fulltime">
               <Partime />
            </Route>

            <Route exact path="/">
               <Home />
            </Route>





          </Switch>
        </div>
      </Router>
    );
  }







  export default App;
